script: |
  super -f text -I q8648.spq | sort > q8648.out

inputs:
  - name: q8648.spq
    data: |
      SELECT DISTINCT - 96 AS col2, + ( + col1 ) * col0 + - col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q8648.out
    data: |
      -96	420
      -96	4230
      -96	700
